import React from 'react';

 const Fields = () => {
     var equalmark = '='
     var multimark = 'x'
     var plusmark = '+'

 return ( 
     <div>
         <input type="text" value="" />{equalmark} <input type="text" value="" />{multimark}<input type="text" value="" />{plusmark} <input type="text" value="" />
     </div>
  )
};

export default Fields;
